import LoginPage from './Screens/loginPage';
import LandingPage from './Screens/landingPage';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/' exact={true}>
          <LandingPage/>
        </Route>
        <Route path='/register'>
          <LoginPage/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
